using System.Collections.Generic;
using System.Threading.Tasks;
using Develappers.BillomatNet.Types;
using Xunit;

namespace Develappers.BillomatNet.Tests.IntegrationTests
{
    public class InvoiceServiceDocumentsIntegrationTests : IntegrationTestBase<InvoiceService>
    {
        public InvoiceServiceDocumentsIntegrationTests() : base(c => new InvoiceService(c))
        {
        }

        [Fact]
        public async Task GetInvoicePdf()
        {
            var result = await SystemUnderTest.GetPdfAsync(1322705);

            Assert.NotNull(result);
        }

        [Fact]
        public async Task SendInvoiceEmail()
        {
            var mail = new InvoiceMail
            {
                From = "info@billomat.com",
                Recipients = new Recipients
                {
                    //E-Mail should be changed to test
                    To = "info@billomat.com",
                    Cc = "example@mail.com"
                },
                Subject = "TestMail",
                Body = "Sehr geehrte Damen und Herren, das ist ein Test",
                Attachments = new List<Attachment>
                {
                    new Attachment
                    {
                        Filename = "Rechnung_RE2.pdf",
                        Mimetype = "application/pdf",
                        Base64File = ""
                    }
                }
            };

            await SystemUnderTest.SendMailAsync(1143262, mail);
        }
    }
}
